import React from "react";
import { Card } from "react-bootstrap";

const Instruction = () => {
  return (
    <Card>
      <Card.Body>
        <Card.Title className="text-dark">Card Title</Card.Title>
        <Card.Subtitle className="mb-2 text-muted">
          How to review and download viewing history
        </Card.Subtitle>
        <Card.Text className="text-dark">
          <ol>
            <li>From a web browser, go to your Account page.</li>
            <li>
              Open the Profile & Parental Controls settings for the profile you
              want to see.
            </li>
            <li>Open Viewing activity. </li>
            <li>If you see a limited list, use the Show More button.</li>
          </ol>
        </Card.Text>
        <Card.Link href="#">Card Link</Card.Link>
      </Card.Body>
    </Card>
  );
};

export default Instruction;
